package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import com.fasterxml.jackson.annotation.JsonFormat;import com.fasterxml.jackson.databind.annotation.JsonDeserialize;import com.fasterxml.jackson.databind.annotation.JsonSerialize;import com.rongke.utils.DateJsonDeserializer;import com.rongke.utils.DateJsonSerializer;import org.springframework.format.annotation.DateTimeFormat;import java.io.Serializable;import java.util.Date;/** * @CallRecords * @用户通话记录(call_records) * @version : Ver 1.0 */@TableName("call_records")public class CallRecords implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:主键id	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long id;	/**	 * @备注:用户id	 * @字段:user_id BIGINT(19)	 */	@JsonFormat(shape = JsonFormat.Shape.STRING)	private Long userId;	/**	 * 备注:用户id	 */	@TableField(exist = false)	private User user;	/**	 * @备注:对方手机号	 * @字段:phone VARCHAR(255)	 */	private String phone;	/**	 * @备注:主叫时长	 * @字段:call_time_z VARCHAR(255)	 */	private String callTimeZ;	/**	 * @备注:主叫次数	 * @字段:call_count_z INT(10)	 */	private Integer callCountZ;	/**	 * @备注:被叫时长	 * @字段:call_time_b VARCHAR(255)	 */	private String callTimeB;	/**	 * @备注:被叫次数	 * @字段:call_count_b INT(10)	 */	private Integer callCountB;	/**	 * @备注:创建时间	 * @字段:gmt_datetime DATETIME(19)	 */	@JsonSerialize(using=DateJsonSerializer.class)	@JsonDeserialize(using=DateJsonDeserializer.class)	@DateTimeFormat(pattern = "yyyy-MM-dd HH:mm:ss" )	private Date gmtDatetime;	/**	 * 备注: 联系人姓名	 */	private String userName;	/**	 * 备注: 联系人关系	 */	private String link;	/**	 * 备注: 联系人关系	 */	private String pUserId;	public String getUserName() {		return userName;	}	public void setUserName(String userName) {		this.userName = userName;	}	public String getLink() {		return link;	}	public void setLink(String link) {		this.link = link;	}	/**	 * @备注:状态：1,正常 2,删除	 * @字段:status INT(10)	 */	private Integer status;	public CallRecords(){	}	public CallRecords(		Long id	){		this.id = id;	}	public void setId(Long id) {		this.id = id;	}	public Long getId() {		return this.id;	}	public void setUserId(Long userId) {			this.userId = userId;			}	public Long getUserId() {			return this.userId;	}	public void setUser(User user) {		this.user = user;	}	public User getUser() {		return this.user;	}	public void setPhone(String phone) {		this.phone = phone;	}	public String getPhone() {		return this.phone;	}	public void setCallTimeZ(String callTimeZ) {		this.callTimeZ = callTimeZ;	}	public String getCallTimeZ() {		return this.callTimeZ;	}	public void setCallCountZ(Integer callCountZ) {		this.callCountZ = callCountZ;	}	public Integer getCallCountZ() {		return this.callCountZ;	}	public void setCallTimeB(String callTimeB) {		this.callTimeB = callTimeB;	}	public String getCallTimeB() {		return this.callTimeB;	}	public void setCallCountB(Integer callCountB) {		this.callCountB = callCountB;	}	public Integer getCallCountB() {		return this.callCountB;	}	public void setStatus(Integer status) {		this.status = status;	}	public Integer getStatus() {		return this.status;	}	public String getpUserId() {		return pUserId;	}	public void setpUserId(String pUserId) {		this.pUserId = pUserId;	}	public Date getGmtDatetime() {		return gmtDatetime;	}	public void setGmtDatetime(Date gmtDatetime) {		this.gmtDatetime = gmtDatetime;	}}